                    <div>
                        {/* <button class="btn btn-primary mr-4 sign-up-btn">Sign-up</button> */}
                        <a className="btn btn-secondary" href="#learn-more">Learn More</a>
                    </div>
                </div>
                
        </div>
    )
}

